import React from 'react';
import './AboutUs.css'; // Importing the provided CSS file

const AboutUs = () => {
  return (
    <div className="analysis-container">
      <h2>Mental State Application</h2>
      <p>
        Our project is to prepare a mental state application to understand user text and speech input and provide an optimal solution. Our team consists of the following members:
      </p>
      <ul>
        <li>Sreeram</li>
        <li>Vijay Bala</li>
        <li>Saii Varun</li>
        <li>Steve Joshua</li>
        <li>Rajasree</li>
        <li>Varshini</li>
        <li>Tejasvi</li>
      </ul>
      <p>
        Our goal is to put efforts to reduce one's mental pressure through an application.
      </p>
    </div>
  );
};

export default AboutUs;
